INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(1, 'Śledztwo Onetu w sprawie prezesa PZT. We wtorek kolejne relacje ofiar', , 'politics', 'Napastowanie seksualne oraz wulgarne odzywki, w tym m.in. skierowane do jednej z kelnerek słowa: \"napiłbym się mleka z twoich cycuszków, spałbym w nich i je ssał\" — jutro w Onecie ujawnimy, w jaki sposób prezes Polskiego Związku Tenisowego Mirosław Skrzypczyński zachowywał się podczas tegorocznego Memoriału im. Lecha i Marii Kaczyńskich w Kozerkach.', 3, '2022-11-21');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(2, 'Eksperyment Holandii zapewnił im zwycięstwo. Niespodziewany debiutant grał jak z nut', , 'Football', 'Holendrzy pokonali Senegal 2:0, choć do sensacji było blisko. Oranje oddali trzy celne strzały, z których dwa znalazły drogę do siatki. Eksperyment Louisa van Gaala, który w bramce postawił m.in na Andriesa Nopperta, opłacił się.\r\n\r\nSenegalczycy z problemami, bo bez Sadio Mane, jednak z najlepszą generacją zawodników w historii. Gwiazda Bayernu Monachium nie pojechała do Kataru, gdyż czeka ją kilkumiesięczna przerwa z powodu zerwania ścięgna. Pomimo tego kadra Lwów Terangi na papierze wygląda bardzo mocno, a Senegalczycy rywalizują w najlepszych ligach na świecie. Polskim kibicom w pamięci zapadła ich potyczka z Biało-Czerwonymi na mundialu w Rosji. Wtedy górą byli podopieczni Aliou Cisse, jednak ostatecznie zmagania zakończyli na fazie grupowej. Teraz oczekiwania mają większe.', 3, '2022-11-22');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(3, 'Marszałek pozbawia PiS władzy na Śląsku. \"Nie zgadzam się z taką polityką\"', , 'Politics', 'PiS stracił władzę na Śląsku. — Poziom smrodu przekroczył granicę — komentuje w rozmowie z Onetem marszałek województwa Jakub Chełstowski, który potwierdza, że wraz z grupą radnych opuszcza Prawo i Sprawiedliwość. — Nie ma opcji powrotu. Rezygnuję z członkostwa w PiS. Cztery lata temu było przejęcie przez PiS władzy przez transfer Wojciecha Kałuży, dzisiaj ja wychodzę — dodaje stanowczo.\r\n\r\nW Katowicach trwa sesja Sejmiku Śląskiego. Atmosfera jest napięta, zarządzono kolejną przerwę. Radni z PiS panikują i szukają wsparcia w telefonach do Warszawy. Dziś, cztery lata po przejęciu Sejmiku przez partię Jarosława Kaczyńskiego, PiS będzie musiała oddać stery władzy opozycji. Z PiS żegna się marszałek Jakub Chełstowski oraz trójka dotychczasowych radnych tej partii.\r\n\r\n', 4, '2022-11-16');
INSERT INTO `entries` (`id`, `title`, `photo`, `categories`, `content`, `id_autor`, `date`) VALUES
(4, 'Cezary Kulesza: potrzebujemy zwycięskiej mentalności', , 'Football', '— Zdecydowanie nie biorę w ciemno remisu w Meksykiem. Walczymy o pełną pulę! To jest mundial. Impreza, o której marzą wszyscy. Żeby tu być. Przed telewizorem obejrzą go Włosi, Czesi czy Szwedzi. A my tu jesteśmy. Dlatego teraz chcemy zrobić kolejny krok i wyjść z grupy. Żeby tego dokonać potrzebujemy jednak zwycięskiej mentalności — mówi Cezary Kulesza w rozmowie z Przeglądem Sportowym Onet. Prezes Polskiego Związku Piłki Nożnej przyznał, że zna już skład na to spotkanie. Nie zabrakło także odniesienia się do słynnych już słów Grzegorza Krychowiaka.\r\n\r\nJakie panują nastroje przed inauguracją mistrzostw świata w naszym wykonaniu? Odczuwa już pan dodatkowe emocje?\r\n\r\nFaktycznie pojawia się dodatkowy dreszczyk emocji i trochę stresu, natomiast widzę, jak ciężko pracuje cały zespół. Dlatego zachowuję spokój. Zawodnicy są w pełni skupieni, świadomi swojego celu. Spodziewam się bardzo wyrównanego starcia z Meksykiem, oczywiście z pozytywnym dla nas zakończeniem.', 4, '2022-11-16');

